import React, { useEffect } from 'react';
import AudioRecorder from './components/AudioRecorder';

function App() {

  useEffect(() => {
    fetch("http://localhost:8080/")
      .then(res => res.json())
      .then(data => console.log(data)) // Should print: { message: "Hello, Project EVANS!" }
      .catch(err => {
        console.error("Fetch error:", err);
        alert("Error: " + err);
      });
  }, []);

  return (
    <div>
      <h1>Project Medical EVANS (Frontend)</h1>
      <AudioRecorder />
    </div>
  );
}

export default App;
